template:
{% set testimonials = [testimonial_1, testimonial_2, testimonial_3] %}

<section class="testimonials-tmx">
    <div class="container py-14 py-md-16 position-relative">
        <div class="row position-relative">
            <div class="col-8 left-section">
                <div class="swiper-container" data-loop="true" data-drag="true" data-margin="30" data-dots="true">
                    <div class="swiper left-content">
                        <div class="swiper-wrapper">
                            {% for testimonial in testimonials %}
                                {% if testimonial %}
                                    {% set doc = frappe.get_doc("Testimonials", testimonial) %}
                                    <div class="swiper-slide" >
                                        “{{doc.testimonial}}”
                                    </div>
                                {% endif %}
                            {% endfor %}
                        </div>
                    </div>
                </div>

            </div>
            <div class="right-img position-absolute">
                <img src="{{img}}">
            </div>
        </div>

    </div>
</section>

<style>
    .testimonials-tmx .left-section {
        padding: 120px 50px;
        background-color: rgba(33, 103, 120, 0.08);
    }
    .testimonials-tmx .right-img {
        max-width: 564px;
        right: 0;
    }
</style>
